import React from "react";

export default function Steps() {
  return (
    <div>
      <hr
        className="step step1"
        style={{
          background: "lime",
          color: "lime",
          borderColor: "lime",
          height: "3px",
          width: "50%",
        }}
      />
      <br />
      <hr
        className="step step2"
        style={{
          background: "blue",
          color: "blue",
          borderColor: "vlue",
          height: "3px",
          width: "50%",
        }}
      />
    </div>
  );
}
